INSERT INTO `products` (`product_id`, `product_title`, `product_info`, `product_type`, `product_price`, `product_image`) VALUES
(2, 'Apple iPhone 11 128Gb Black (MHDH3) Slim Box', 'Нова система двох камер. Можна робити фотознімки з широким і надшироким кутом огляду. Оновлений інтерфейс і нова надширококутна камера дозволять побачити і зняти те, що відбувається за межами кадру. Знімати і редагувати відеоролики тепер так само легко, як фотографії. Це як і раніше неймовірно популярна камера, але з абсолютно новими перспективами. Знімайте з розмахом - з новою надширококутною камерою область зображення у чотири рази більша. У кадр поміститься все. Безкраї пейзажі. Сцена разом з глядачами на музичному фестивалі. Вся сім`я на тлі запаморочливих краєвидів, заради яких ви пролетіли тисячі кілометрів.\r\n', 'headphones', '15000', );
INSERT INTO `products` (`product_id`, `product_title`, `product_info`, `product_type`, `product_price`, `product_image`) VALUES
(5, 'Смартфон Apple iPhone 14 Pro Max 128GB Deep Purple (MQ9T3)', 'Як і в попередньому поколінні, iPhone 14 Pro Max – найбільший та найавтономніший смартфон лінійки «Pro». Діагональ дисплея пристрою становить 6,7 дюймів, виконаний за технологією OLED Super Retina XDR. Саме на дисплеї видно найбільшу інновацію 2022 року у смартфонах Apple для покращення взаємодії з користувачем – «Dynamic Island». Цю фішку можна позначити сучасним обіграванням фронтальних датчиків FaceID та оновленої 12 Мп селфі-камери з автофокусом. Дизайн смартфона не зазнав змін, збільшився тільки майданчик під тильні камери і додалося нове забарвлення Deep Purple. iPhone 14 Pro Max обладнано абсолютно новою 48 Мп основною камерою з апертурою ƒ/1.78, удосконаленою за всіма характеристиками. Процесор традиційно теж оновився і тепер це Apple A16 Bionic, продуктивності якого вистачить на багато років.', 'smartphone', '55000', );
